			<image height="20" href="https://secure.gravatar.com/avatar/88138fd2809cc5da62ff578d9db8da50?s=40&amp;d=identicon" preserveaspectratio="none" style="-webkit-tap-highlight-color: rgba(0, 0, 0, 0);" width="20" x="210" y="1960"></image>
			<text fill="#000000" font="14px Monaco, monospace" font-family="&quot;Arial&quot;" font-size="10px" stroke="none" style="-webkit-tap-highlight-color: rgba(0, 0, 0, 0); text-anchor: start; font-family: Monaco, monospace; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; font-stretch: normal; line-height: normal;" text-anchor="start" x="235" y="1970">
				<tspan dy="4.5" style="-webkit-tap-highlight-color: rgba(0, 0, 0, 0);">
					In our quest to pursue optimal coding principals, effecient algorithms, and proper system architecture we have expanded upon our hook wrapper class to add a wide range of support for various well known, often used minecraft core classes such as World, WorldClient, EntityPlayerSP, PlayerControllerMP, and GameSettings. Not only did we provide wrappers for fields and methods belonging to these classes, but we also added the ability to get the class instances themselves from their proper wrappers. This way any user looking to use the wrapper design who finds themselves using code belonging to non-wrapped members, they can use the non-wrapped referenced provided by the wrapper until support has been added later. This in no way shape or form will result in the user having to maintain legacy code. In other non-wrapper news we've fixed a very serious typo in the mappings class for net/minecraft/entity/EntityLivingBase. A 'g' took the place of 'f' which turned 'strafing' into 'straging' which is an obvious issue that is deserving of our full attention. We will not allow sloppy mistakes in this quality client written totally by Ceanko and nobody else. Besides, this will all be re-written the day before launch right? A promise is a promise.
				</tspan>
			</text>

				<tspan dy="4.5" style="-webkit-tap-highlight-color: rgba(0, 0, 0, 0);">
